import React, { useState, useEffect } from 'react';
import { request } from '../axios_helper';

const DataTable = () => {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [filters, setFilters] = useState({
        year: '',
        price: '',
        region: '',
        surface: '',
        type: '',
        quarter: ''
    });

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        request('GET', '/api/prices/')
            .then(response => {
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                setError(error.message);
                setLoading(false);
            });
    };

    const handleFilterChange = (event) => {
        const { name, value } = event.target;
        setFilters({ ...filters, [name]: value });
    };

    const filteredData = data.filter(item => {
        for (const key in filters) {
            if (filters[key] && item[key] !== filters[key]) {
                return false;
            }
        }
        return true;
    });

    if (loading) {
        return <div>Loading...</div>;
    }

    if (error) {
        return <div>Error: {error}</div>;
    }

    return (
        <div>
            <form>
                <label>
                    Year:
                    <input type="text" name="year" value={filters.year} onChange={handleFilterChange} />
                </label>
                <label>
                    Price:
                    <input type="text" name="price" value={filters.price} onChange={handleFilterChange} />
                </label>
                <label>
                    Region:
                    <input type="text" name="region" value={filters.region} onChange={handleFilterChange} />
                </label>
                <label>
                    Surface:
                    <input type="text" name="surface" value={filters.surface} onChange={handleFilterChange} />
                </label>
                <label>
                    Type:
                    <select name="type" value={filters.type} onChange={handleFilterChange}>
                        <option value="">Any</option>
                        <option value="rynek pierwotny">Rynek Pierwotny</option>
                        <option value="wtórny">Wtórny</option>
                    </select>
                </label>
                <label>
                    Quarter:
                    <input type="text" name="quarter" value={filters.quarter} onChange={handleFilterChange} />
                </label>
            </form>
            <table className="table">
                <thead>
                    <tr>
                        <th>Region</th>
                        <th>Quarter</th>
                        <th>Type</th>
                        <th>Surface</th>
                        <th>Year</th>
                        <th>Price</th>
                    </tr>
                </thead>
                <tbody>
                    {filteredData.map(item => (
                        <tr key={`${item.region}-${item.quarter}-${item.year}`}>
                            <td>{item.region}</td>
                            <td>{item.quarter}</td>
                            <td>{item.type}</td>
                            <td>{item.surface}</td>
                            <td>{item.year}</td>
                            <td>{item.price}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default DataTable;
